#include <stdio.h>
#include <vector>

using namespace std;


class Solution {
public:
    Solution(vector<int>& w) {
        int sum=0;
        N=w.size();
        Sums=vector<int>(N,0);
      
        for(int i=0;i<N;i++){
            sum+=w[i];
            Sums[i]=sum;
        }
        S=Sums.back();
    }
    
    int pickIndex() {
        int RandWeight=rand()%(S+1);
       
        int end=N-1;
        int begin=0;
        while(begin<end){
            int mid=(begin+end)/2;
           
            if(Sums[mid]>=RandWeight) end=mid;
            else begin=mid+1;
        }
        return begin;
    }
private:
    vector<int> Sums;
   
    int N;
    int S;
};

